import { Box } from "@mui/system";
import React from "react";
import "./Quote.css";
const Quote = () => {
  return (
    <div className="bgg">
      <Box
        className="bg"
        style={{
          height: "60px",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <Box
          style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            width: "800px",
            height: "60px",
            justifyContent: "center",
          }}
        ></Box>
        <h2
          style={{
            width: "2000px",
            display: "flex",
            textAlign: "center",
            backgroundColor: "red",
            fontSize: "25px",
            marginRight: "40vh",
          }}
        >
          KIDDOS Tradezz ,where imagonation has no limits
        </h2>
      </Box>
    </div>
  );
};

export default Quote;
